pragma solidity ^0.4.19;

import "zeppelin-solidity/contracts/ownership/Ownable.sol";
import "zeppelin-solidity/contracts/crowdsale/Crowdsale.sol";
import "zeppelin-solidity/contracts/crowdsale/validation/TimedCrowdsale.sol";

contract Trader is TimedCrowdsale, Ownable {

    uint constant public PERCENT_DELIMITER = 10 ** 3;

    uint public buyCommission;
    uint public sellCommission;
    uint public commissionCollected;

    address public collector;
    address public cashier;

    function Trader(ERC20 _token, uint _buyCommission, uint _sellCommission, uint _rate, address _collector, address _cashier)
    public
    TimedCrowdsale(now, now + 30 days)
    Crowdsale(_rate, address(this), _token)
    {
        require(_collector != address(0));
        require(_cashier != address(0));

        collector = _collector;
        cashier = _cashier;

        buyCommission = _buyCommission;
        sellCommission = _sellCommission;
    }

    function setBuyCommission(uint _commission) external onlyOwner {
        require(_commission > 0);
        buyCommission = _commission;
    }

    function resetBuyCommission() external onlyOwner {
        buyCommission = 0;
    }

    function setSellCommission(uint _commission) external onlyOwner {
        require(_commission > 0);
        sellCommission = _commission;
    }

    function resetSellCommission() external onlyOwner {
        sellCommission = 0;
    }

    function updateClosingTime(uint _newTime) external onlyOwner {
        require(_newTime > 0);

        closingTime = _newTime;
    }

    function closeTrading() external onlyOwner {
        closingTime = now;
    }

    function setRate(uint _rate) external onlyOwner {
        require(_rate > 0);
        rate = _rate;
    }

    function sellTokens(uint _amount) external {
        require(_amount > 0);
        require(_amount <= token.balanceOf(msg.sender));

        uint weiAmount = _amount.mul(rate);
        weiAmount = _extractAndCollectCommissionInWei(sellCommission, weiAmount);
        require(weiAmount <= this.balance);

        msg.sender.transfer(weiAmount);

        token.transfer(cashier, _amount);
    }

    function unsafeSellTokens(address _sender, uint _amount) external onlyOwner {
        require(_amount > 0);
        require(_amount <= token.allowance(_sender, address(this)));

        uint commissionValue = 0;
        uint amountWithoutCommission = 0;
        (amountWithoutCommission, commissionValue) = _extractCommissionFrom(sellCommission, _amount);

        if(commissionValue > 0) {
            token.transferFrom(_sender, collector, commissionValue);
        }

        token.transferFrom(_sender, cashier, amountWithoutCommission);
    }

    function unsafeBuyTokens(address _recipient, uint _amount) external onlyOwner {
        require(_amount > 0);
        require(_amount <= token.balanceOf(address(this)));

        uint commissionValue = 0;
        uint amountWithoutCommission = 0;
        (amountWithoutCommission, commissionValue) = _extractCommissionFrom(buyCommission, _amount);

        if(commissionValue > 0) {
            token.transfer(collector, commissionValue);
        }

        token.transfer(_recipient, amountWithoutCommission);
    }

    // sell less tokens on buy commission value
    function _getTokenAmount(uint256 _weiAmount) internal view returns (uint256) {
        _weiAmount = _extractAndCollectCommissionInWei(buyCommission, _weiAmount);
        return _weiAmount.div(rate);
    }

    function _extractCommissionFrom(uint256 _commission, uint256 _amount) internal returns (uint256, uint256) {
        uint commissionValue = 0;
        uint amountWithoutCommission = 0;
        if(_commission > 0) {
            commissionValue = _amount.mul(_commission).div(PERCENT_DELIMITER).div(100);
            amountWithoutCommission = _amount.sub(commissionValue);
        }
        return (amountWithoutCommission, commissionValue);
    }

    function _extractAndCollectCommissionInWei(uint256 _commission, uint256 _amount) internal returns (uint256) {
        uint commissionValue = 0;
        uint amountWithoutCommission = 0;
        (amountWithoutCommission, commissionValue) = _extractCommissionFrom(_commission, _amount);
        commissionCollected = commissionCollected.add(commissionValue);
        return amountWithoutCommission;
    }

    // money should stay on Trader account
    function _forwardFunds() internal {
    }

    // move collected money to a wallet
    function withdrawFunds(address _wallet) public onlyOwner {
        require(wallet != address(0));

        _wallet.transfer(this.balance);
    }

    // move collected money to a wallet
    function withdrawCommission() public onlyOwner {
        collector.transfer(commissionCollected);
        commissionCollected = 0;
    }
}
